import Footer from "../../components/footer/Footer";
import Banniere from "../../components/banniere/Banniere";
import { Link } from "react-router-dom";

function About(){
    return(
        <>
        <Link to="/">accueil</Link>
       <Banniere/>
       <h3>Ceci est la page d'accueil</h3>
       <Footer/></>
       
    )
}

export default About;
